import Link from 'next/link';
import Image from 'next/image';
import styles from './_components/layout.module.css';
import index from './_components/index_css/index.module.css';

export default function Home(){
    return (
       
            <div className={index.corpo}>
                <div className={index.svg0}>s</div>
                <div className={index.svg1}></div>
                <div className={index.svg2}></div>
                <div className={index.svg3}></div>
            </div>
       
    )
}
